// 単位変換（配列）％->W
function perToW(perArray) {
    return perArray.map(function (value) {
        return value * 995 / 131.5
    });
}
// 単位変換（配列）W->円
function wToYen(wArray) {
    return wArray.map(function (value) {
        return Math.round(value * 23.7 / 1000)
    });
}


